import React from 'react';
import data from "../Cards/CardData.json"

export function Card() {
    return (

        <div className='section'>
            <div className='cocktails-center'>
                {data.map((val) => (
                    <div key={val.id} className='cocktail'>
                        <img src={val.img} alt={val.name} />
                        <p>{val.name}</p>
                        <p>{val.category}</p>
                    </div>
                ))}
            </div>

        </div>
    )
}

// export default Card
